$(document).ready(function(){$("#searchInput").on("keyup",function(){var d,g,f,b,c,e;d=document.getElementById("searchInput");g=d.value.toUpperCase();f=document.getElementById("searchList");b=f.getElementsByClassName("searchRow");for(e=0;e<b.length;e++){c=b[e].getElementsByClassName("searchFor")[0];if(c.innerHTML.toUpperCase().indexOf(g)>-1){b[e].style.display=""}else{b[e].style.display="none"}}})});